import React from 'react';
import {useNavigate} from "react-router-dom";

const EndCollected = () => {
	const navigate = useNavigate();
	const backToInvolved = e => {
		e.preventDefault();
		navigate('../../involved');
	}


	return (
		<div>
			<h1>{'该问卷已结束收集'}</h1>
			<button onClick={backToInvolved}>{'回到首页'}</button>
		</div>
	);
};

export default EndCollected;
